  

// TypeScript Version: 4.1

/**
* Computes the hypotenuse avoiding overflow and underflow (single-precision).
*
* @param x - number
* @param y - number
* @returns hypotenuse
*
* @example
* var h = hypotf( -5.0, 12.0 );
* // returns 13.0
*
* @example
* var h = hypotf( NaN, 12.0 );
* // returns NaN
*
* @example
* var h = hypotf( -0.0, -0.0 );
* // returns 0.0
*/
declare function hypotf( x: number, y: number ): number;


// EXPORTS //

export = hypotf;
